import React, { Fragment, useState } from "react";

const NavBar = ({ setStep }) => {
  return (
    <Fragment>
     <div className="Navbar">
    <div className="leftside">
      <div className="links"></div>
      <a href="/home" onClick={() => setStep(0)}>Home</a>
      <a href="/Task">Tasks</a>
      <a href="/User">User</a>
    </div>  
    </div>
    </Fragment>
  );
};
export default NavBar;
